(26, 0, '2017-09-01', 'Natalia Franco', '316 744 0045', 1, 120000000, 'Céspedes, victoria, fatima, nuevo fatima, ', 'Propiedad para remodelar ', 'Cliente interesada en la propiedad del Céspedes de $130 millones, Tiene $80 millones en efectivo.\r\n- 8 Noviembre 2017 (La cliente ofrece máximo por el lote de entierros $109, esta pendiente enseñar dos lotes en el Alvernia que va a recibir Elvia).\r\n- 14 Noviembre (se le comunico que los lotes de entrerios están nuevamente disponibles ahora con una constructora pero ella dice ya no tener ningún interés en esos lotes , esta esperando información de los del Alvernia con Elvia).\r\n- 12 Diciembre (se llamo ofrecer el lote de lomitas de $110. pero no le interesa la ubicación, ella esta pendiente de la pagina).\r\n-El 05 Ene se le ofreció el lote que nos ingreso en el Nuevo Fatima de $100 pero no le gusta, solo quiere Alvernia y Entrerios.', 1, '2017-09-01', 'si'),
(27, 0, '2017-09-06', 'Viviana Lopez', '317 434 0603', 1, 170000000, 'Príncipe, Buenos Aires.', 'Busca propiedad con buenos acabados para estrenar ', 'Andrea realizo recorrido el 06-Sept.\r\n- 9 Noviembre (Celular apagado).\r\n- 14 de Noviembre (celular apagado, le deje un mensaje por Whatsapp).\r\n', 1, '2017-09-11', 'si'),
(28, 0, '2017-09-05', 'Eider Julian', '3114763718', 1, 350000000, '', 'Busca propiedad amplia para guardar 5 carros, con varias habitaciones o busca propiedad antigua para', 'Pendiente mostrarle la casa del Victoria de $380 millones.\r\n- 9 Noviembre 2017 (El cliente ya compro propiedad).', 1, '2017-09-11', 'no'),
(29, 0, '2017-09-05', 'Andrea Olaya', '315 482 9583', 1, 150000000, 'Sobre la Paso Ancho del Príncipe', 'Busca propiedad sobre la paso ancho del principe para montar establecimiento comercial (restaurante)', 'La clienta esta negociando una casa de $130 millones a dos casas del local que tenemos en la paso ancho. \r\n- 9 Noviembre (contesto la mama y dice que ya no están  comprando propiedad). ', 1, '2017-09-11', 'no'),
(30, 0, '2017-08-24', 'Cristina Ospina', '3122319527', 1, 120000000, 'Victoria, Céspedes, Tomas Uribe', 'Busca propiedad con muy buen área para remodelar', 'Pendiente hacerle recorrido con las nuevas propiedades que se le han enviado al WhatsApp\r\n- 9 Noviembre 2017 (Cancelaron la inversión en  propiedad raíz, por problemas familiares... Pendiente llamar 10 de Noviembre Luisa)\r\n- 10 Noviembre 2017 (Ya compro propiedad).', 1, '2017-09-18', 'no'),
