(55, 0, '2017-10-26', 'Leidy P.', '316 423 2453', 1, 150000000, 'La ceiba, alrededores ', 'Casa unifamiliar ', 'Cliente de OLX,  El esposo esta en Bogota y llega en Noviembre (pendiente llamar el 23 de Noviembre.\r\n\r\nEl 05-Ene se le iba a mostrar la casa del Descanso de Elvia pero la clienta se va de viaje con el esposo, regresan nuevamente el miércoles 10-Ene para volver a coordinar.', 1, '2017-11-23', 'si'),
(56, 0, '2017-10-26', 'Daniel Bermudez ', '322 249 8599', 1, 140000000, 'Victoria', 'Propiedades para remodelar ', 'Cliente de OLX (pendiente llamar el 27 de Octubre para coordinar el recorrido a las 10:00 am) Cliente con Elvia. \r\n- Recorrido el 2 de Noviembre con Elvia - Compra por medio de credito levapan, le dan respuesta en un mes, estar llamando y enviando información, queda muy interesado en la del victoria frente al gimnasio del pacifico. ', 1, '2017-10-27', 'si'),
(57, 0, '2017-10-26', 'Esperanza L', '312 211 7151', 1, 150000000, '-', 'Busca casa Bifamiliar', 'Cliente de OLX (esta buscando casa para la sobrina) --> El día 26 de Octubre se le enseño la casa de\r\n- 15 Noviembre 2017 (No Contesto el teléfono)', 1, '2017-10-26', 'si'),
(58, 0, '2017-10-26', 'Alex Arbelaez', '225 8043', 10, 10, '-', '-', 'Cliente de OLX --> aun no ha sido posible una comunicación directa con el, estoy pendiente de una ll\r\n15 Noviembre 2017 (Linea ocupada, no ha sido posible comunicarnos con el cliente y solo nos facilito un numero fijo el cual siempre esta ocupado).', 1, '2017-10-30', 'si'),
(59, 0, '2017-10-26', 'Yulissa M.', '317 852 5073', 1, 150000000, 'LA ceiba y alrededores ', 'Busca una casa de un piso con plancha ', 'Cliente de OLX --> se le enviaron propiedades de buenos aires por Whatsap, esperando respuesta para.\r\n(La clienta busca casa en el barrio la Ceiba de la ciudad de Cali) no tenemos propiedades disponibles en ese sector. ', 1, '2017-10-27', 'no'),
(61, 0, '2017-10-26', 'Piedad Perez L. ', '314 510 7040', 1, 10, 'Zarzal Valle', 'Busca casa en Zarzal de 70 Mtrs2', 'Cliente de OLX --> Se le dio información e la propiedad de Zarzal de $230 - Esperando respuesta. \r\n- 15 Noviembre  2017 (La clienta me informo que ahora solo buscan para alquilar en Zarzal casa o apto).', 1, '2017-10-27', 'si'),
(62, 0, '2017-10-26', 'Elizabeth ', '315 335 5176', 3, 30000000, 'Urbanizacion Agua viva', 'Lite agua viva de 90 Mtrs2', 'Clienta de OLX  -->  Coordinar cita para el lunes 30 de Octubre\r\n-  15 Noviembre 2017 ( se retomo a la clienta y se coordino cita para las 3:00 pm)', 1, '2017-10-30', 'si'),
(63, 0, '2017-10-26', 'Daniela Tobar', '318 471 1297', 1, 98000000, 'Pueblo Nuevo', 'Busca basa bifamiliar de $90 Millones ', 'Clienta de OLX -->  Cita para el día Viernes 27 de octubre a las 3:00 pm. \r\n-  28 de Octubre (La clienta nunca contesto el teléfono y no asistió a la cita, ahora nos comunica que ya compro otra propiedad).', 1, '2017-10-27', 'no'),
(64, 0, '2017-10-26', 'Eloy Solorza ', '318 282 5786', 3, 10, 'Farfan - Agua Clara - La 25 - Solo Tulua ', 'Busca un lote urbanizable para 60 casas de 60 Mtrs2', 'Cliente  en busca de terreno grande, no da área exacta no presupuesto. ', 1, '2017-10-26', 'si'),
(65, 0, '2017-10-26', 'Marco', '317 817 4545', 1, 220000000, 'Lomitas ', '', 'Se le enseño la propiedad del Jazmin pero no  le gusto, le intereso la bifamiliar de Lomitas $220 millones. \r\n- 9 de Noviembre,  Esta haciendo aun vueltas con el banco BBVA,  Mostrarle mas opciones el presupuesto le bajo a $180 Máximo por que se le presentarlo inconvenientes. (cita para sábado 11 de Noviembre).\r\n- 15 Noviembre (coordinar un recorrido para el Sábado 17 con propiedades de $180).\r\n- 21 Noviembre (Se coordino cita para las 5:00 pm, recorrido con Andrea)', 1, '2017-10-30', 'si'),
(66, 0, '2017-10-26', 'Mauricio', '315 827 0615', 1, 130000000, 'LA villa - buenos barrios ', 'Busca casa unifamiliar con 4 habitaciones bien ubicada ', 'Cliente muy interesado en la casa de la villa, pero no tiene si no $130 millones. Buscar otras opcio\r\n- 15 Noviembre (El cliente ya compro propiedad en la villa)', 1, '2017-10-26', 'no'),
(67, 0, '2017-10-27', 'Albeiro Hernanadez O.', '318 224 7537', 1, 130000000, '-', '-', 'Cliente de OLX --> Interesado en la propiedad de Villa Liliana de $130...   Va hablar con la esposa \r\n - (Lunes 30 de Octubre, A la esposa no le gusta el barrio, no quieren recorridos, van a estar pendientes de la pagina y cuando vean algo de interés ellos llaman o escriben)', 1, '2017-10-30', 'si'),
(68, 0, '2017-10-27', 'Daniela', '318 218 1751', 3, 20000000, '-', '-', 'Clienta de OLX --> Interesada en el lote de Urbanización Monaco, se le dio un valor mínimo de $21 millones. \r\n- 01 Noviembre - Se llama para informar que el propietario no acepta la moto como parte de pago, pero no contesta el teléfono. ', 1, '2017-10-27', 'si'),
