(76, 0, '2017-10-02', 'Jefer', '316 621 9505', 3, 85000000, '', '', 'Esta interesado en comprar lote o apartamento de $85.000.000, se le enseño el lote de Villa Campestre de $85\r\n- 9 Noviembre (Celular apagado).\r\n- 14 Noviembre 2017 (Celular Apagado - le deje un mensaje por Whatsapp).\r\n- 21 Noviembre (Llamo Andrea y coordino cita a las 4:00 pm para enseñar el lote de Villa Campestre).\r\n-22 Nov se llamo para informarle que el lote subió de precio a $88 porque se entrega con planos y licencia pero no contesto.\r\n-28 Nov se volvio a llamar pero no contesta.\r\n-28 Junio 2018 - Se llamo para ofrecer el lote de san benito $98 - No contesto ', 1, '2017-11-07', 'si'),
(77, 0, '2017-10-02', 'Hernan', '318 783 6700', 6, 100000000, '', '', 'Interesado en casa campestre de Robledo $100 millones\r\n- 9 Noviembre 2017 (Desea permutar por una casa de dos pisos unifamiliar en el barrio Palo Bonito, el negocio solo de puede hacer después del 15 de diciembre por que aun no ha liberado la documentación de la propiedad,  agregue anotación para llamarlo nuevamente el 11 de Diciembre averiguar como va la gestión).', 1, '2017-11-07', 'si'),
(78, 0, '2017-10-04', 'Amanda Rodriguez', '315 735 2205', 1, 70000000, '', '', 'Se le mostró propiedad bifamiliar de $63 millones en Bosques de Maracaibo, ella quedo en tomar una decisión pero no concreto nada y la casa ya no esta disponible. Esta pendiente buscarle una nueva opción. \r\n- 9 Noviembre 2017 (La compra depende de una propiedad que esta vendiendo la hermana en Ecuador, y  la hermana aun no ha podido venderla). Volver a llamar en 20 días. \r\n-  28 Noviembre (se llama a ofrecer el lote de guayacanes de $30 pero nos dice que la hermana ya no va a comprar casa en Tulua).', 1, '2017-11-07', 'no'),
(79, 0, '2017-10-06', 'Diana Gomez', '317 654 9389', 1, 180000000, '', 'Busca casa con garaje eléctrico y 4 alcobas en buen barrio. Presupuesto $200 millones', 'Se le hizo un recorrido con varias propiedades que se le enviaron al Whatsapp pero aun no se ha definido por ninguna. Sigue buscando.\r\n\r\n- 9 Noviembre 2017 (El esposo aun no llega del exterior y tampoco le define si van a invertir en Colombia, pendiente llamar el 4 de Diciembre).', 1, '2017-11-07', 'si'),
