(81, 0, '2017-10-06', 'Beatriz Naranjo', '300 376 6615', 1, 200000000, 'Alvernia, Nuevo Alvernia, Entrerios, Nuevo Principe, Villa Campestre, El Retiro, Sajonia.', 'Busca casa hasta $200 millones en barrios tranquilos y con garaje que quepa camioneta grande.', 'Se le mostró casa del Nuevo Príncipe $182 pero no les gusto porque es muy pequeña. Siguen buscando casa, pero no se ha podido programar recorrido porque esta fuera de la ciudad.\r\n- 9 Noviembre 2017 (No contesta el teléfono).\r\n-14 Noviembre 2017 (no contesto el teléfono, le deje mensaje por Whatsapp). ', 1, '2017-11-07', 'si'),
(82, 0, '2017-10-17', 'Esperanza Duque', '310 538 8163', 1, 70000000, '', 'Interesada en ver casa de Bosques bifamiliar de $63 millones.', 'No se le pudo mostrar porque el día en que se le iba a programar la cita se vendió la casa. Sigue buscando. \r\n- 9 Noviembre 2017 (Aun están buscando propiedad de un piso puede ser, presupuesto máximo $70, Contesto la hermana Yaqueline  y nos dio el numero directo de esperanza 317 326 2021, llamarla mañana).\r\n- 10 Noviembre 2017 (No contesta el teléfono). \r\n- 15 Noviembre (Contesto el teléfono una niña, no fue posible la comunicación).', 1, '2017-11-07', 'si'),
(83, 0, '2017-10-17', 'Jeferson Ruiz', '318 740 5556', 3, 0, 'Loma 1 y Loma 2', 'Interesado en lotes de loma 1 y loma 2', 'No se le enseñaron porque estos lotes son muy grandes y no le alcanza el presupuesto. Esta pendiente mostrarle otros lotes pero solo quiere en loma 1 o 2.\r\n- 9 Noviembre 2017 (Celular apagado)\r\n- 15 Noviembre 2017 (celular apagado)', 1, '2017-11-07', 'si'),
(84, 0, '2017-10-17', 'Antonio Plaza', '313 728 7605', 1, 200000000, 'Villa Campestre', '', 'Se le hizo un recorrido con Elvia y Andrea. Quedo muy interesado en la casa de Lomitas de $195 de Elvia, se le entrega en $195 sin terminar y en $218 terminada pero deben de hacer gestión por el Bancolombia. El cliente dice que no le interesa esta muy costosa // Se le ofreció casa que va a recibir Elvia en Villa Campestre de 1 piso en $240 pero no le interesa porque esta muy costosa.\r\n- 9 Noviembre 2017 (Llamar el martes 14 de Noviembre,  el cliente esta esperando la respuesta de una propiedad que le gusto dependiendo de eso el martes coordinamos o no un recorrido)\r\n- 14 N', 1, '2017-11-14', 'si'),
(85, 0, '2017-10-18', 'Carlos Andres', '300 521 5070', 1, 300000000, '', 'Busca casa amplia', 'Se le mostro la casa del Retiro de $270 de Andres, pero a la esposa no le gusto la ubicación. Se le han enviado otras opciones al Whatsapp pero el cliente no ha tenido tiempo para hacer un nuevo recorrido.\r\n- 9 Noviembre 2017 (Interesado en una de las opciones que se le envió por Whatsapp, teníamos recorrido para el sábado 11 pero se cancela para el 18 de Noviembre llamara antes para confirmar).\r\n\r\n-24-Nov se le pregunto cual de las opciones que se le enviaron le inteesan para realizar recorrido y no nos dio respuesta. Llamarlo el 07-Dic para coordinar recorrido.', 1, '2017-11-17', 'si'),
(86, 0, '2017-10-19', 'Diego Delgado', '313 652 2274 / 310 368 1481', 3, 100000000, 'San Pedro, Andalucia o Tulua', 'Interesado en lote de $90 millones frente a comfandi', 'Se le iba  a enseñar el lote pero no le interesa porque este no cuenta con el servicio de energía y mas o menos hasta dentro de 1 año la compañía de electricidad no hace la instalación en este sector. Sigue buscando.\r\n28 Junio 2018 - Se llamo para ofrecer un lote en San Benito, pero nos informa que ya compro propiedad. ', 1, '2017-11-07', 'no'),
(87, 0, '2017-10-19', 'Ricardo Gutierrez', '313 740 6492', 1, 230000000, 'Victoria', 'Busca casa para estrenar', 'Recorrido realizado por Elvia. Se le enseño casa del Victoria $220 de Jhon Jairo y casa del Nuevo Príncipe $230 de Juan Pablo. Le gusto mucho la de Jhon Jairo del Victoria pero esta pendiente que defina un negocio que tiene de una bodega a 2 cuadras de la alcaldía para saber si la compra o no y también le gusto una casa de Elvia en Villa Campestre PH.\r\n- 15 Noviembre 2017 (Aun no ha podido vender la bodega y de esto depende para comprar propiedad - Elvia le esta haciendo gestión para solicitar un crédito con el Banco).\r\n-', 1, '2017-11-07', 'si'),
(88, 0, '2017-10-19', 'Nelson Marin', '313 673 6505', 1, 120000000, 'Centro', 'Interesado en casa del centro de $135 millones', 'Esta casa la iba a enseñar Elvia pero no se le pudo mostrar porque nos cancelo la cita despues de haberle dado la direccion / Despues el cliente fue solo a ver la casa y le ofrecio a la dueña $120, muy poco / El cliente solo quiere conseguir las direcciones de las propiedades para ir a negociar directamente con los dueños.', 1, '2017-11-07', 'no'),
