(91, 0, '2017-11-09', 'Juan Esteban ', '320 605 3766', 1, 98000000, 'Pueblo Nuevo', '', 'Cliente interesado en la propiedad bifamiliar de Pueblo Nuevo, Se encuentra en Popaya, programar cita para el martes 14 de noviembre en horas de la tarde. \r\n- 14 de Noviembre, El cliente aun no se encuentra en Tulua, nos facilito el numero de la esposa para coordinar cita con ella,  311 465 0988 Jennifer rosero. (llamar el jueves en la mañana para coordinar cita en horario de la tarde).', 1, '2017-11-16', 'si'),
(92, 0, '2017-11-09', 'Bertha Lemos', '318 826 1286', 11, 130000000, 'La esperanza, buenos aires y alrededores. ', 'Casa bifamiliar en buen estado. ', 'Cita para el dia 9 de Noviembre a las 4:45 pm con Elvia, se le enseña la casa del barrio el Descanso de $130 bifamiliar de Elvia y la de progresar.\r\n- 18 Noviembre 2017 (La llame a ofrecerle la propiedad de flor de la campana pero no le interesa solo tiene dos habitaciones la casa) CLIENTA PENDIENTE AUN ESTA BUSCANDO \r\n- 21 Noviembre (La clienta ya programo cita con Elvia para el Miércoles en la mañana,  se le van a mostrar dos propiedades con terceras personas).-\r\n- Elvia le recibió la casa de la esperanza para ayudar a vender,  la compra depende de la venta de esta propiedad. ', 2, '2017-11-09', 'si'),
(93, 0, '2017-11-09', 'Yamileth Gomez.', '317 797 7029', 3, 66000000, 'Picacho', 'Busca lote ubicado sobre vía principal y pavimentada. ', 'Cita para el día viernes 10 de noviembre a las 10:00 am, con Andrea. \r\n\r\nLa cita que se tenia programada para el jueves 16-Nov se cancelo porque ella no es la que va a comprar el lote, es la hermana que esta en el exterior, pero la hermana no cuenta con todo el dinero para comprar. Quedamos en que la hermana nos iba a agregar al whatsapp para que nos contacte y nos cuente con exactitud con cuanto dinero cuenta y a cuanto tiempo podría dar el excedente.\r\n- 28 Noviembre (se llamo para ofrecer el lote de Guayacanes $35 millones, nos dice que la que compra es la hermana y que ya le paso nuestro numero para que se contacte con nosotros, no me quiso dar el numero de la hermana por que esta en el exterior).', 1, '2017-11-09', 'si'),
(94, 0, '2017-11-08', 'Jenny / Diego', '321 594 1780 / 318 865 6758', 1, 100000000, 'Victoria', 'Interesada en casa del Victoria de $110 millones para remodelar', 'Se le va a enseñar casa del Victoria de $110 millones el 09-Nov-17 a las 6:00 pm.\r\nQuedaron muy interesados y hay que volver a programar para verla nuevamente.\r\n\r\n- 14 Noviembre ( a la señora Jenny no le gusto la propiedad por que esta muy escondida y es  para negocio, buscan sobre la 33 Viernes 17 Preguntar a Andrea que hablo con el don Diego)\r\n\r\n-17-Nov se le envio otra opcion al whatsapp, casa del Victoria de $130 (Don Diego me informa que ya conoce esta casa y no les sirve el sector, buscan sobre la 33 - esta casa ya no esta disponible) Sigue buscando.\r\n\r\n-El 23-Nov se le ofrecio la casa del Cespedes, pero el cliente nos informa que solo quiere comprar en el Victoria, entre la 33 hasta la 36.', 1, '2017-11-08', 'si'),
(95, 0, '2017-11-08', 'Astrid Uribe', '310 486 3306', 1, 0, '', '', 'Astrid Uribe nos entregara casa en administracion en Santa Ines (Calle 9na B No. 17 - 16), la dueña de la casa es la abuela Paulina Sanchez 322 416 1682, pero en escritura esta a nombre de un tio de doña Astrid. Esta pendiente para el 24 de Noviembre tomarle las fotos que la casa ya este desocupada.\r\n\r\nAndrea fue a ver la casa y sugiere como precio para alquilar $380.000. \r\n\r\nSe llamo el 21-Nov y la señora Astrid nos informa que aun no han desocupado la casa, que mas o menos para la segunda semana de Dic la desocupan para colocarla en alquiler, por el momento estan pintando la casa y tapando goteras para entregar la propiedad en perfectas condiciones. Llamar nuevamente el 11-Dic.', 4, '2017-11-08', 'si'),
