(125, 0, '2017-11-09', 'Sandra Milena Loaiza', '321 617 9336', 1, 240000000, 'Villa Campestre, Nuevo Principe.', 'Busca casa de un piso o unifamiliar para estrenar.', 'El sábado 11-Nov se le hizo recorrido, quedo muy interesada en la casa de Jhon Jairo de Villa Campestre $270. Hay que llamarla el viernes 17-Nov.\r\n\r\nAsí mismo, esta clienta tiene el corretaje No. 052, esta pendiente que lo diligencie y traiga los documentos, tambien esta pendiente que cancele los $50.000. Aun no ha traido el corretaje porque no sabe cual de las dos propiedades que tiene es la que quiere vender.\r\n\r\nHay que llamarla el viernes 24-Nov para programar cita para el sabado 25\r\n\r\n24-Nov se llamo para coordinar y no contesto.\r\n\r\n01-Dic  se llamo para coordina y doña Sandra estaba muy ocupada, dijo que ella personalmente se comunicaba con la inmobiliaria el sábado 02-Dic pero no nos llamo.', 1, '2017-11-10', 'si'),
(126, 0, '2017-11-09', 'Lorenza Peña', '301 647 0705', 1, 300000000, 'Alvernia, Nuevo Alvernia.', 'Busca casa amplia en sector salud', 'Se le enviaron opciones al Whatsapp el 15-Nov, esta pendiente hacerle recorrido.\r\nSe le escribio el lunes 20-Nov y nos informo que ya habia comprado propiedad.', 1, '2017-11-10', 'no'),
