(128, 0, '2017-11-14', 'Jhon Alexander Cely', '321 242 6057', 1, 75000000, 'Altamira (Andalucía)', 'Interesado en la propiedad de un piso en Andalucía barrio alta mira.', 'Cliente OLX. (Llamar en horas de la tarde para coordinar cita para el miércoles 15 de Noviembre). Se coordina la cita con el primo Jair Mosquera 311 340 0835 miércoles 4:00 pm\r\n- 20 Noviembre (el señor Jair no se encuentra  disponible, esta en Cali - Quedamos de comunicarnos nuevamente el Jueves  23 de Noviembre para coordinar en horas de la tarde).\r\n', 1, '2017-11-14', 'si'),
(129, 7, '2017-11-14', 'Ligia Tabares. ', '316 699 5816', 1, 275000000, 'San benito', 'Propiedad lujosa ', 'Clienta de OLX, interesada en la casa de san benito de $275, No contesta el teléfono. \r\n- 9 Noviembre (La Clienta no contesta el teléfono)\r\n- 14 Noviembre (La clienta vuelve a escribir por OLX, se insiste pero no contesta llamadas, le deje por la conversación nuestros números telefónicos).\r\n- 1 Diciembre (La clienta no contesta la llamada para coordinar la cita para mañana sábado)\r\n- 21 Noviembre (Cita programada para hoy a las 5:30 pm).', 1, '2017-11-14', 'si'),
(130, 9, '2017-11-14', 'Jairo A.', '318 710 1296', 6, 150000000, 'La Marina ', 'Finca cafetera de 40.000 Mtrs2 (Hernan)', 'Cliente de OLX (Interesado en permutar la finca de la Marina de $130 por una casa de un piso en la campiña, casa de un piso con plancha de 7x16)\r\n- 14 Noviembre (Queda la cita programada para el día Miércoles 15 a las 3:00 pm).', 1, '2017-11-14', 'si'),
(131, 0, '2017-11-14', 'Erik Hernan', ' 310 231 1243', 1, 0, '', '', 'Cliente de OLX, tiene una  casa para la venta en el barrio el jardín, No la dará para la vente pero finalizando mes por que no se encuentra en Tulua, Llamar el Jueves 30 de Noviembre. ', 2, '2017-11-30', 'si'),
(132, 0, '2017-11-14', 'Oscar Garcia Hurtado.', '314 800 5525', 6, 130000000, 'La Marina y aledaños ', 'Busca finca en la Marina y alrededores de 3 a 4 plazas. ', 'Cliente OLX, Interesado en finca de la marina de don Hernan, queda cita programada para el miércoles 15 de Noviembre a las 4:00pm. \r\n- 15 noviembre, se cancela la cita para el día sábado 17 por cuestiones de lluvia. \r\n- 20 Noviembre (El cliente nos manifiesta que es conveniente esperar hasta que el clima mejore)\r\n- 24 Noviembre (El cliente se encuentra en Cali, llamar el próximo lunes para coordinar la cita).\r\n- 27 Noviembre (El cliente no puede en el transcurso de la semana la cita queda programada para el 2 de diciembre llamar un día antes para confirmar)\r\n- 1 Diciembre (Se llamo al cliente para confirmar la cita y nos manifiesta que ya compro propiedad en Trujillo).', 1, '2017-11-14', 'no'),
(133, 0, '2017-11-14', 'Fernando Mendez', '319 463 9877', 3, 70000000, 'Tamboral Andalucia', '', 'Cliente de OLX (Interesado en el lote de tamboral Andalucía, de $70 millones, cita programada para el jueves 16 de Noviembre a las 10:00am.  \r\n\r\nEsta cita la cancelo el cliente, dijo que lo llamaran el viernes 17-Nov en la mañana para coordinar nuevamente una cita \r\n\r\n', 1, '2017-11-14', 'si'),
(134, 0, '2017-11-15', 'Wilson Zamora', '317 664 9820', 10, 0, '', 'Busca propiedad para invertir que le genere muy buena renta', 'Correo: rat1551@hotmail.com\r\nEsta interesado en el edificio del Nuevo Principe de $750.000 y tiene casa unifamiliar en el Fatima para que le reciban como parte de pago y el excedente en efectivo. Se le envio toda la información al correo electronico.\r\n\r\nEl 16-Nov también se le envió al correo electrónico la información del hotel que tenemos en el Sajonia de $630, pero el cliente esta mas inclinado por el edificio del Nuevo Príncipe, esta pendiente enviarle las fotografías del futuro para ascensor. \r\n\r\nEl 21-Nov se le envio toda la informacion sobre el futuro del ascensor en el edificio del Nuevo Principe.\r\n\r\nEl 27-Nov se le volvió a reenviar toda la información tanto al correo como al whatsapp porque dijo que no había recibido ninguna información hasta el momento.\r\n\r\nEl 04-Dic se le volvió a escribir al whatsapp para saber que pensó sobre la información que se le envió del futuro que tiene el edificio para la instalación del ascensor. Llamarlo el 06-Dic.\r\n\r\nEl 06-Dic Andrea hablo con el y estamos pendientes porque el cliente ya tenia un negocio por definir, se le presento propuesta de dos propiedades de Elvia, una en Ciudadela las Palmas y otra en San Benito.', 1, '2017-11-15', 'si'),
(135, 0, '2017-11-14', 'Monito - Montallantas', '318 647 3285', 1, 600000, 'Barrio Popular', '', 'Busca propiedad para alquiler en el mes de Diciembre', 5, '2017-11-15', 'si'),
(136, 0, '2017-10-12', 'Mariana Ardila', '314 846 9952', 1, 600000, '', '', 'Busca casa en alquiler (clienta de parte de Monica Vega)', 5, '2017-11-15', 'si'),
(137, 0, '2017-11-15', 'William Rosero', '317 503 0260', 1, 140000000, '', '', 'Busca casa unifamiliar o de un piso con plancha. Se le enviaron varias opciones al whatsapp el 15-Nov, esta pendiente coordinarle recorrido.\r\n\r\nEl 20-Nov se le escribio por Whatsapp, el cliente nos informa que no esta en la Ciudad, que en cuanto llegue se comunica con nosotros para programar el recorrido.', 1, '2017-11-15', 'si'),
(138, 0, '2017-11-14', 'Luis Fernando', '318 889 8540', 3, 0, '', '', 'Dueño de lotes campestres y finca via Aguaclara, callejon Los Caimos.\r\n\r\nLotes con sobre oferta:\r\nLote No. 01: Área 331.50 Mts 2. $45.000.000, solo hay que responderle por $36.000.000 al dueño.\r\nLote No. 02: Área 384.10 Mts 2. $45.000.000, solo hay que responderle por $40.000.000 al dueño.', 2, '2017-11-15', 'si'),
(139, 0, '2017-11-10', 'Juan Felipe Sala', '311 270 3567', 1, 75000000, '', '', '10-Nov se le envio al whatsapp las fotos de casa Andalucia de $75. Pendiente preguntarle que penso o si la quiere ver.\r\n\r\n20-Nov el cliente nos informo que ya no estaba interesado en comprar en Andalucia, solo quiere comprar en Trujillo.', 1, '2017-11-15', 'si'),
(140, 0, '2017-11-10', 'Maria Edilma', '315 756 3023', 1, 150000000, 'Nuevo Principe', 'Busca propiedad que quede cerca a la Uceva', '15-Nov se le envio opciones al whatsapp. Pendiente hacer recorrido.\r\n\r\n20-Nov se le escribio por Whatsapp para coordinar recorrido pero nos informa que la casa del Nuevo Principe de $182 que se le habia enviado no le sirve porque tiene un problema en las rodillas y no puede subir gradas, solo busca casa de un piso.', 1, '2017-11-15', 'si'),
