(142, 0, '2017-11-09', 'Camilo Potes Correa / Marina (Esposa)', '300 774 1042 / 232 3441', 1, 0, '', '', 'Propietario casa Villa Campestre / Carrera 45 No. 38 - 54\r\nBanco Davivienda\r\nCuenta de ahorro No. 009-170-328-000\r\nA nombre de: Carlos Alberto Potes.', 4, '2017-11-15', 'si'),
(143, 0, '2017-10-19', 'Yakeline', '312 294 5287', 3, 70000000, '', '', 'El 19-Oct se le enviaron opciones al whatsapp.\r\n\r\nEl 16-Nov se le mostraron los lotes via Aguaclara - los caimos y se le vendio un lote, llamarla el miercoles 22-Nov para que nos suministre todos los datos para la promesa de compraventa.\r\n\r\nEl 22-Nov se llamo y nos informo que el esposo también quiere ver el lote antes de tomar una decisión pero no ha tenido tiempo; la clienta quedo que en cuanto el esposo pudiera ver el lote ella se comunicaba para coordinar la cita.\r\n\r\nEl 04-Dic se llamo y nos informo que el esposo no quiso comprar el lote porque mejor decidió invertir en una casa que les ofrecieron para remodelar.', 1, '2017-11-22', 'no'),
(144, 0, '2017-11-02', 'Selene Betancouth', '322 548 7493', 3, 50000000, '', '', 'El 02-Nov se le enviaron varias opciones al Whatsapp.\r\n\r\nEl 16-Nov se le hizo recorrido con los lotes de los caimos via aguaclara y los lotes de agua viva -  El recorrido lo hizo Andrea. Le gusto mucho el lote de $45 los caimos.\r\n\r\nEl 20-Nov se llamo pero no contesto, se le dejo mensaje por Whatsapp preguntando que penso sobre el lote que se le mostro en los Caimos. \r\n\r\nEl 23-Nov Andrea hablo con la clienta y esta le informa que por el momento no están interesados en comprar.', 1, '2017-11-16', 'no'),
(145, 0, '2017-11-17', 'Camila Sarria', '318 7880348', 1, 0, 'Villa Campestre, Alvernia, Entrerios', '', 'El 17-Nov se le envio al Whatsapp la casa de San Benito en alquiler.  Esta cliente no tiene codeudores para tomar la casa.', 5, '2017-11-17', 'si'),
(146, 0, '2017-11-17', 'Juan Carlos Arroyave', '322 542 7537', 1, 150000000, 'El Horizonte', '', 'Interesado en la casa bifamiliar del Horizonte $150. Pendiente coordinarle recorrido para el lunes 20-Nov.\r\n\r\nNo se le ha podido enseñar la propiedad porque no se ha podido lograr que don Juan Carlos coordine con los inquilinos de las casas para enseñarla.', 1, '2017-11-17', 'si'),
(147, 0, '2017-11-17', 'Carlos', '316 294 7750', 1, 150000000, 'El Horizonte', '', 'Interesado en la casa bifamiliar del Horizonte $150. Pendiente coordinarle recorrido para el lunes 20-Nov.\r\n\r\nNo se le ha podido enseñar la propiedad porque no se ha podido lograr que don Juan Carlos coordine con los inquilinos de las casas para enseñarla.', 1, '2017-11-17', 'si'),
(148, 0, '2017-11-17', 'Luz Marina', '232 8269', 1, 350000, '', '', 'Interesada en ver apto Saman del Norte en alquiler. Se le va a enseñar la casa el lunes 20-Nov.\r\n\r\nEl 20-Nov la clienta vio la propiedad y esta considerando si toma solo el apartamento o si lo toma tambien con la bodega, es para montar una iglesia, se le ofrecio tambien el local de la paso ancho. La cliente quedo en comunicarse nuevamente con nosotros en el transcurso de la semana para definir ', 5, '2017-11-17', 'si'),
(149, 0, '2017-11-20', 'Richard', '316 784 6777', 1, 0, '', 'Busca propiedad que genere rentas', 'Cliente OLX --> (el cliente es de Pasto, el va a venir con el papa para ver opciones pero no tiene precisión sobre el día, queda en comunicarse con nosotros en cuanto pueda viajar) Estar llamando. \r\n', 1, '2017-11-20', 'si'),
