(164, 0, '2017-11-23', 'Jhon Jairo Diaz', '312 224 9649', 1, 150000000, '', 'Casa Bifamiliar', 'El 23-Nov se le enviaron varias opciones al whatsapp, esta pendiente que nos confirme que propiedades son de su interes para programarle recorrido.\r\n\r\nEl 04-Dic se le escribió al wahtsapp para saber que había pensado sobre las opciones que se le enviaron. Llamar el 05-Dic para coordinar recorrido.\r\n\r\nEl 07-Dic se llamo y nos dijo que todas las opciones que le habian enviado ya las conocia y no le gustaron, el señor busca una propiedad central que genere rentas, tenerlo en cuenta por si nos llega a entrr una buena propiedad.\r\nEste mismo día se hablo con el señor de una casa bifamiliar en el Ruben Cruz que tiene para la venta, cerca a Olimpica, la esta vendiendo en $165 precio mínimo, no la quiere compartir, ni enviarnos las fotos, solo hay que tenerla en cuenta por si nos ingresa algún cliente.', 1, '2017-11-23', 'si'),
(165, 0, '2017-11-23', 'Stephany Martinez', '305 300 2233', 1, 80000000, '', '', 'El 23-Nov se le enviaron varias opciones al whatsapp, esta pendiente coordinarle recorrido.\r\n\r\nEl 04-Dic se le escribio al whatsapp para saber que habia pensado sobre las opciones que se le enviaron y para saber cuando podian coordinar el recorrido. Llamar el 05-Dic para coordinar cita.', 1, '2017-11-23', 'si'),
(166, 0, '2017-11-23', 'Carlos', '317 517 3943', 8, 250000000, '', '', 'El 23-Nov se le enviaron varias opciones al whatsapp, queda pendiente coordinarle el recorrido.\r\n\r\nEl 04-Dic nos informo que las opciones que se le enviaron se le salían del presupuesto, que solo tiene $250. Se le envio casa campestre de $300. ', 1, '2017-11-23', 'si'),
