(170, 0, '2017-11-20', 'Oscar Marino', '313 626 3878', 1, 240000000, 'Villa Campestre', '', '20-Nov se le enviaron varias opciones al whatsapp.\r\n\r\n25-Nov se le hizo recorrido, quedo muy interesado en la propiedad de Jhon Jairo de $260. Cliente de la inmobiliaria pero el recorrido lo hizo Elvia. El cliente quedo en confirmarle a Elvia para hacer negocio. Estar pendiente de que los clientes no se vayan a contactar directamente con Jhon Jairo y hagan el negocio entre ellos.\r\n\r\nEl cliente tiene la mayor parte del dinero en efectivo y el excedente lo solicitaria por el fondo de empleados. \r\n\r\nEl 04-Dic se le pregunto a Elvia por este cliente y ella nos informo que don Oscar Marino quedo en comunicarse con ella en el transcurso de la semana.\r\n\r\nHay que llamarlo el lunes 11-Dic de parte de Elvia para preguntarle que dia le queda facil para realizar recorrido, se le va a mostrar: Casa Diana Lomitas / Casa Leidy y Juan Carlos San Benito / Casa Villa Campestre $260 Sol Milena / Casa Lomitas Karime $220 y la Casa de Lomitas de Elvia $225.\r\n\r\nEl 11-Dic se llamo pero paso a buzón. \r\n\r\nEl 13-Dic se llamo y nos solicito que lo llamáramos nuevamente el martes 19 para coordinar fecha de recorrido.\r\n\r\nEl 20-Dic se llamo nuevamente pero el telefono no tenia señal, pasaba a buzón. ', 1, '2017-12-12', 'si'),
(171, 0, '2017-11-27', 'Oscar Marquez', '311 770 1346', 1, 200000000, 'Salesianos y alrededores ', 'Casa grande ', 'Interesado en la casa de diagonal a químicos Tulua,  Cita con  Elvia a las 4:00 pm en la oficina. \r\n\r\nEl cliente tiene $80.000.000 y va a solicitar $120.000.000 por crédito de libre inversión.', 1, '2017-11-27', 'si'),
