(181, 0, '2017-11-28', 'Jorge', '315 590 0769', 13, 33000000, '', 'Interesado en Camioneta Captiva.', 'El 28-Nov se hablo con el cliente, el señor esta interesado pero primero quiere que traigan la camioneta hasta Tulua para poderla ver.\r\n\r\nEl 30-Nov se estuvo llamando para decirle que la camioneta se va a traer solo si el negocio es seguro, pero no contesto.\r\n\r\nEl 04-Dic se siguió llamando en varias ocasiones pero de una pasa a buzón.\r\nEl 06-Dic se siguió llamando en varias ocasiones pero de una pasa a buzón.\r\nEl 07-Dic se siguió llamando en varias ocasiones pero de una pasa a buzón.', 1, '2017-12-04', 'si'),
(182, 0, '2017-11-28', 'Arleida Lopez / Jorge Lopez ', '318 806 5197', 3, 70000000, '', '', 'El 28-Nov llamaron preguntando por el lote de Villa Campestre de $88 pero a la final no les intereso.\r\n\r\nEl 29-Nov se les mostro lote del Picacho de $66 y quedaron muy interesados en comprarlo.\r\n\r\nEl 01-Dic Andrea se reunió en la oficina con la señora Arleida para pautar el negocio.\r\n\r\nEl 04-Dic se llamo a doña Arleida y nos informo que estaba esperando que el don Jorge el sobrino le definiera si compran o no el lote, estan revisando si de verdad cuentan con la mitad del dinero para hacer promesa.\r\n\r\nEl 07-Dic se llamo a doña Arleida y me iforma que el sobrino esta gestionando para completar la mitad del dinero para firmar la promesa, quedamos en que ella le iba a decir al sobrino que se comunicara con nosotros para ofrecerle el servicio de gestión de crédito y revisar bien con cuanto dinero cuenta en realidad y cuanto tiempo necesitaría para el excedente.\r\n\r\nEl 11-Dic se llamo a doña Arleida para que ella le informe al sobrino que se les recibe los $10 millones que tienen para firmar la promesa y se les da 45 dias para que cancelen el excedente de $55 millones, volver a llamar el jueves 14-Dic para ver si el sobrino esta de acuerdo.\r\n\r\nEl 18-Dic doña Arleida se comunico y nos informo que el sobrino por el momento decidió no comprar lote, primero quiere reunir todo el dinero para poder comprar.', 1, '2017-12-04', 'si'),
(183, 0, '2017-12-04', 'Maria Teresa Aveldaño', '317 779 5418', 1, 350000, 'Saman del Norte', '', 'El 05-Dic se le iba a enseñar el apartamento Saman del Norte, pero la clienta no la quiso ver porque   no le gusto la entrada ni compartir el anden con el local de comidas rapidas.', 5, '2017-12-05', 'no'),
