(285, 0, '2018-01-04', 'Leidy Jhoana', '318 683 3566', 1, 180000000, 'Centro', '', 'El 04-Ene se le iba a enseñar la propiedad de Grafiartes de $180 pero la clienta aprovecho que la casa estaba abierta y la vio sola antes de la cita. Dijo que iba a pensarlo porque hay que hacerle muchos arreglos a la casa. Volver a llamar el miércoles 10-Ene.', 1, '2018-01-09', 'si'),
