(287, 0, '2018-01-03', 'Alvaro Victoria / Maria Erazo', '316 729 5805', 11, 200000000, 'Maracaibo', '', 'El 04-Ene se le enseño la casa de Maracaibo de $185. (Cliente invercol, recorrido con Elvia), al cliente le pareció la propiedad muy costosa, esta pendiente mostrarle otras opciones. \r\n\r\nEste cliente es a través de crédito bancario. ', 1, '2018-01-04', 'si'),
(288, 0, '2018-01-03', 'Nicolas Mahecha', '311 233 6190', 6, 330000000, 'La Marina', '', 'Interesado en finca La Marina $330, el cliente dijo que en la semana del 09-Ene se comunicaba para informar cuando tenia disponible para ver la propiedad.\r\n\r\nEsta finca solo se puede mostrar hasta el 15-Ene porque los dueños están de vacaciones.', 1, '2018-01-04', 'si'),
(289, 0, '2018-01-04', 'Gustavo Adolfo Valencia', '316 742 8278', 8, 0, '', '', 'El 04-Ene se le envió al whatsapp la propiedad de Rancho Chico de $370, se trato de coordinar cita para enseñarle la casa pero los dueños están de vacaciones y regresan el 10-Ene. Pendiente volver a coordinar la cita.\r\n\r\nSe coordino cita para el Dom 14-Ene a las 2:00 pm pero caundo se llamo al cliente para confirmar nuevamente el Domingo, informo que no estaba en la ciudad. Volver a coordinar para el Sabado 20-Ene.', 1, '2018-01-04', 'si'),
(290, 0, '2018-01-04', 'Camilo / Suley Romero (Esposa)', '320 786 4075 / 314 628 0630', 1, 180000000, 'Victoria', '', 'El 04-Ene se le enseño la casa de $170 del Victoria, casa de $180 del Nuevo Príncipe y una casa de $175 de Diego comisionista en Lomitas (Recorrido Andrea).\r\n\r\nEl cliente en el recorrido nos informa que en realidad solo cuenta con $160 millones, volver a llamar el miercoles 10-Ene y mirar que otras opciones se le pueden enseñar.\r\n\r\nEl 10-Ene se le va a hacer nuevo recorrido con propiedades que tiene Gabriela comisionista.\r\n\r\nEl 10-Ene se le envio al whatsapp casa Nuevo Principe de $185, se programo cita para ver la propiedad el 11-Ene a las 6:00 pm \r\n\r\nEl 11-Ene se les enseño la propiedad y quedaron muy interesados, ellos la van a comprar por medio de banco, vover a llamarlos el martes 16-Ene para preguntarles como van con la gestion del banco.\r\n\r\nEl 16-Ene se llamo y el cliente nos informa que la esposa estuvo pensándolo bien y realmente hay varios detalles de la casa que no le gustaron y la descartaron, ellos siguen buscando propiedad entre $150 y $180 en el Príncipe, San Benito, El Retiro. ', 1, '2018-01-04', 'si'),
