(300, 0, '2018-01-05', 'Carlos Dario', '317 702 1667 ', 11, 190000000, 'Progresar', 'Busca propiedad bifamiliar hasta $190 que mida mas de 6x16 Mts 2', 'El 05-Ene se le iba a enseñar la propiedad del Progresar pero la dueña no contesto para coordinar la cita, volver a coordinar el 10-Ene. Este cliente nos informa que él vendio una casa bifamiliar que tenia de 6x16 Mts 2 porque quedaba muy estrecho con los vehiculos que tiene, por lo tanto busca casa que sea mas amplia que la que tenia. ', 1, '2018-01-09', 'si'),
(301, 0, '2018-01-05', 'Jose Alarcon', '316 349 3967', 3, 0, 'Bugalagrande', '', 'Interesado en lote Urb. Monaco, tiene carro para permutar por el lote, Ford Laser modelo 2005, 142.000 Km recorridos, motor 1.3, 2do propietario que tiene el carro, full equipo, aire acondicionado, equipo de sonido, vidrios electricos, el carro lo tiene por $14 millones. \r\n\r\nEl cliente quedo en venir a la oficina el martes 09-Ene para enseñarnos el carro y posteriormente ver el lote de Monaco.\r\n\r\nEl jueves 11-Ene se llamo y nos informo que ya había comprado un lote alli mismo en la Urb. Monaco, mucho mas grande y mas económico. ', 1, '2018-01-09', 'no'),
(302, 0, '2018-01-05', 'Luis Carlos Aguilar', '313 282 5354', 1, 180000000, 'Nuevo Principe', '', 'El 05-Ene se le iba a mostrar la casa del Nuevo Príncipe de $180 pero el cliente se encontraba en Buga y no podía ver la casa ese día, hay que programar nuevamente para el martes 09-Ene a las 5:30 pm\r\n\r\nEl 11-Ene se llamo para programar nuevamente, pero el cliente dijo que por el momento no iba a ver la propiedad porque el esta comprando sin afan, que en cualquier momento se vuelve a comunicar con nosotros para coordinar una cita.', 1, '2018-01-09', 'si'),
