(309, 0, '2018-01-10', 'Rubi Parra', '317 290 5495', 1, 160000000, 'Fatima, Victoria.', 'Busca propiedad amplia. ', 'El 10-Ene se le mostro la casa Nuevo Fatima $155 Sonia España y casa Salesianos $260 Gustavo Pineda, no le gustaron, pendiente seguirle buscando propiedad. (Recorrido Andrea)\r\n\r\nEl 11-Ene se le enseña una propiedad que consiguió Andrea en el Victoria de 9x35 Mts2 en $210 neg remodelada, casa del Nuevo Fatima de $155 de Sonia España y casa de Pueblo Nuevo de Gabriela pero no le gusto ninguna de estas propiedades.\r\n\r\nAun sigue comprando, pendiente buscarle mas opciones.\r\n\r\nLa clienta ya compro propiedad. ', 1, '2018-01-11', 'no'),
(310, 0, '2018-01-10', 'Diana Carolina Ocampo', '318 557 6986', 1, 120000000, 'San Antonio', '', 'El 10-Ene se le iba a enseñar la casa de San Antonio de $120, pero la persona encargada de mostrarla nunca llego a la cita, se reprograma nuevamente para verla el 11-Ene a las 3:00 pm (Clienta invercol, recorrido Elvia)\r\n\r\nEl 11-Ene se le mostró la propiedad de San Antonio y quedo muy interesada en comprarla, estar pendiente de Elvia que esta tratando de llegar a un acuerdo con don Jairo sobre la comisión para poder hacer el negocio y en caso de que no se de esta pendiente que Elvia le muestre otras opciones que ella tiene (El Descanso, Progresar)\r\n\r\nEl negocio de San Antonio lo habian cerrado en $121.800.000', 1, '2018-01-11', 'si'),
