(316, 0, '2018-01-12', 'Bertha', '315 557 1379 / 661 8396', 2, 220000000, 'Versalles - Cali', '', 'Interesada en apartamento del edificio Sephia en Versalles Cali de Humberto Tigreros, pero don Humberto nos confirmo que en este momento esta negociando el apto, volver a llamar a Humberto Tigreros el jueves 18-Ene para confirmar si lo vendio o si aun sigue disponible, pero el nuevo precio del apto es $265, y la administracion esta en $349.000', 1, '2018-01-15', 'si'),
