(322, 0, '2018-01-09', 'Jorge Gutierrez', '318 773 9964', 3, 0, '', '', 'Cliente interesado en lote de Entrerios de $125.\r\n\r\nEl 15-Ene se llamo para preguntarle que había pensado sobre el lote y nos informo que aun esta interesado pero que tuvo un percance familiar y primero esta tratando de resolver este asunto, el dijo que cuando estuviera listo nuevamente para comprar se comunicaría con nosotros.', 1, '2018-01-15', 'si'),
