(326, 0, '2018-01-16', 'Gloria Ariza', '315 928 8585  ', 1, 180000000, 'Nuevo Principe, Victoria, Lomitas, San Benito', '', 'El 17-Ene se le enviaron varias opciones al whatsapp, esta pendiente que nos confirme cuales de las propiedades que se le enviaron quiere ver.\r\n\r\nEl 17-Ene se le hizo recorrido y quedo muy interesada en la propiedad que tiene Elvia en Lomitas de Karime $220, doña Gloria va a comprar a través de crédito con el banco de Occidente pero todavía no tiene ningún aprobado, apenas va a iniciar la solicitud, ella quedo en comunicarse con Elvia para darle los datos de la persona que le esta ayudando con el crédito en el banco.\r\n\r\nEl lunes 22-Ene se llamo y nos informo que el sabado 20-Ene vio otra propiedad con terceros que le intereso mucho y aun esta indecisa si comprar esta propiedad o la que tenemos nosotros en Lomitas, ella quedo que en cuanto tomara la decision de cual casa iba a comprar inmediatamente nos avisaba; y la persona que le va a ayudar con el credito es directamente la gerente del banco de occidente.\r\n\r\nEnero 29 - No contesto-\r\nFebrero 13 - La cliente nos informa que compro la propiedad que vio con un tercero.', 1, '2018-01-17', 'no'),
