(330, 0, '2018-01-15', 'Carlos Correal ', '314 421 0419', 12, 0, '', '', 'Tiene 4 locales y 2 apartamentos en el Palmar para entregarnos en administracion pero aun no los ha terminado (estan en obra gris), don Carlos quedo que en cuanto los terminara nos informaba para coordinar una cita para que lo asesoremos en el precio de alquiler y entregarnos la propiedad en administracion. Volver a llamar el 02-Feb.\r\n\r\n2 Locales de 3.20 Mts de frente por 8 Mts de fondo y 2 locales esquineros de 4 Mts de frente por 3.30 Mts de fondo, en el segundo piso 2 apartamentos de 2 habitaciones.\r\nBarrio El Palmar / Calle 23 No. 04-26\r\nCorreo: carlos correal-88@hotmail.com', 4, '2018-01-17', 'si'),
(331, 0, '2018-01-15', 'Bernabi Morales / Sandra Morales', '315 839 9157 / 316 878 5284', 1, 200000000, '', '', 'Buscan propiedad amplia, como mínimo 8 o 9 Mts de frente y de fondo de 25 Mts en adelante.\r\n\r\nEsta pendiente mostrarles:\r\n$200 - 8x50 Mts - Victoria - Gabriela Comisionista\r\n$       -  10x36 Mts - Príncipe - Gabriela Comisionista\r\n$220 - 10x50 Mts - Salesianos - Amparo y Maritza\r\nCasa Salesiano doña Nancy\r\n\r\nEl sabado 20-Ene se les enseño solamente la propiedad del Salesianos frente a químicos, quedaron muy interesados y ya se inicio proceso en el banco Bancolombia para el crédito.  La solicitud de crédito quedo a nombre de Alexander morales Gutiérrez y la semana del 29 Enero nos informan quien y cuando se va a realizar el peritaje.\r\n\r\nDon Bernabi nos informa que el peritaje se realizara la segunda semana de Febrero.', 1, '2018-01-17', 'si'),
