(353, 0, '2018-01-25', 'Merlany Nuñez', '311 355 4462', 1, 110000000, 'La Esperanza', '', 'El jueves 25-Ene Elvia le enseño la casa de la Esperanza de $110, pero la clienta esta buscando hacer el negocio directo con la propietaria y quiere sacar a la inmobiliaria, Elvia esta pendiente de esto (Casa Inmobiliaria que solo puede enseñar Elvia y Clienta de la inmobiliaria).', 1, '2018-01-29', 'si'),
(354, 0, '2018-01-24', 'Yeraldine Colorado', '316 361 8366', 1, 180000000, 'Nuevo Principe', '', 'El 24-Ene se le mostro la casa del Nuevo Principe de $185, quedo interesada pero quiere ver tambien la del Nuevo Principe de $190 para tomar una decision.\r\n\r\nEl 26-Ene se le programo la casa del Nuevo Principe de $190 pero nos dijo que no estaba en la ciudad y que ya estaba en proceso de comprar otra propiedad de $140 en este mismo barrio.\r\n\r\nEl lunes 29-Ene Andrea la llamo y nos informo que ya habian cerrado negocio con la casa de $140. ', 1, '2018-01-29', 'no'),
