(440, 0, '2018-03-12', 'Nilson / Luz Mery', '313 716 7328 / 312 753 1238', 1, 300000000, 'Salesianos.', 'Propiedad comercial', 'Los clientes tienen un pre aprobado con el banco de occidente.\r\nDirección clientes: Calle 29 No. 26 - 44 Centro\r\n\r\nEl 16-Feb se le enseño a don Nilson casa para remodelar Salesianos $382.500.000 pero se le sale del presupuesto.\r\n\r\nEl 10-Mar se le hizo recorrido a la esposa de don Nilson, se le mostro casa playas $180, casa doña aura $230, casa salesianos $220 (casa que antes era de doña Nancy), casa Salesianos $230 gustavo pineda, casa doce de octubre $260 de Ramiro, y casa del Popular $320.\r\n\r\nLa clienta quedo muy interesada en la casa del 12 de Ocrubre de $260, pero esta casa tiene una hipoteca por $100 millones con el banco bbva, se esta mirando la posibilidad de que la clienta consiga los $100 para pagar la hipoteca y el excedente se paga con el credito o se esta revisando si el banco de occidente puede comprarle la hipoteca al banco bbva. En caso de que no se pueda comprarían la casa del Salesianos $220 (Andres - antes casa de doña Nancy).\r\n\r\nEl 15-Marzo se llamo a doña Luz Mery y nos informo que ellos aun no tienen pre aprobado del banco, que en cuanto sepan el valor ella se comunica con nosotros para ver nuevamente las casas. \r\n\r\nEl 26-Marzo se llamo y doña Luz Mery nos informo que don Nilson aun no ha regresado de viaje, vuelve el martes 27-Mar, hay que volverla a llamar el miercoles finalizando la tarde para preguntarle que averiguo don Nilson con la gerente del banco que es directamnete la persona que les esta colaborando, en caso de que no le tengan respuesta podria tomar el servicio de créditos por la inmobiliaria.\r\n\r\nEl 02-Abril se llamo a doña Luz Mery y nos informo que el esposo ya esta nuevamente pendiente del tramite de crédito que tienen por el banco, hay que llamar directamente a don Nilson el lunes finalizando la tarde para ver que razón nos tiene.\r\n\r\nEl 03 y 04 de Abril se ha llamado en varias ocasiones a don Nilson pero el telefono pasa a buzon, el 04 de Abril se llamo a doña Luz Mery y ella nos dice que no sabe si el esposo ha podido hacer las gestiones en el banco, que apenas ella logre hablar con el sobre el tema nos llama y nos informa.\r\n\r\nEl 16-May se llamo a los clientes para ver si ya les había salido lo del crédito pero no contestaron. ', 1, '2018-03-12', 'si'),
