(443, 0, '2018-03-14', 'Maria Fernanda', '317 638 3426', 1, 200000000, 'Victoria, principe', '', 'La clienta compra a traves de credito con Bancoomeva. \r\n\r\nEl 14-Marzo se le mostró casa del Victoria $200 de Gildardo, casa del Principe $210 Gabriela y casa Nuevo Principe unifamiliar $180. \r\nQuedo muy interesada en la casa de Gabriela del Principe de $210, esta pendiente volver a coordinar para que vea nuevamente la casa con el esposo el Domingo 18-Marzo.\r\n\r\nEl Domingo 18-Mar Andrea le estuvo llamando para enseñarle la casa pero no contesto, se volvio a llamar el miercoles 21-Mar pero tampoco contesto para coordinar la cita. Y el jueves 22-Mar Gabriela nos informa que esta casa ya no esta disponible.\r\n\r\nPendiente buscarle mas opciones.', 1, '2018-03-14', 'si'),
