(484, 0, '2018-04-09', 'Rubiela Guzman', '311 336 8353', 1, 85000000, 'Andalucia', '', 'Clienta interesada en casa de Andalucia de $85 millones.\r\nEl 09-Abril se le iba a enseñar la casa pero la cita se cancelo porque lluvio, hay que volver a programar para el miercoles 11-Abril.\r\nEl 11-Abril se le enseño la casa de Andalucia $85 y quedo muy interesada, volver a llamar el martes 17-Abr.', 1, '2018-04-10', 'si'),
(485, 0, '2018-04-09', 'Marleny Zapata / Diamantis Pitaoulis', '317 857 8982 / 317 507 8412', 1, 250000000, 'Villa Campestre, Lomitas, San Benito, Nuevo Principe.', '', 'Correo: tptakis8@gmail.com\r\nClientes interesados en tomar la propiedad de Lomitas de Liliana en alquiler con opcion de compra.\r\nAlquiler $1.100.000 y Venta $260.000.000\r\nSe les mando contrato de arrendamieno y promesa de compraventa al correo electronico para su revision, estamos pendientes de que nos definan para firmar.', 1, '2018-04-10', 'si'),
(486, 0, '2018-04-06', 'Maria Angelica', '301 451 2462', 1, 0, 'Victoria, Nuevo Principe, La Colina', '', 'La clienta tiene $80 o $90 en efectivo y $100 por credito hipotecario con el banco ???\r\nEl 06-Abril se les mostró casa de La Colina de $180, quedaron muy interesados y quedaron en hacer una oferta.\r\nEl 10-Abril se llamo nuevamente para conocer la oferta y nos informa que antes de hacer una oferta quieren volver a ver la casa el sábado 14-Abri.\r\nEl 14-Abril se le mostró nuevamente la casa, quedamos a la espera de la evolución en la gestión del crédito que esta realizando la clienta.\r\nEl 17-Abril se llamo para saber como va con la gestión pero no contesto.\r\n', 1, '2018-04-10', 'si'),
(487, 0, '2018-04-06', 'Aleida Jimenez', '318 838 5507', 1, 160000000, 'La Bastilla', '', 'El 06-Abril se le enseño casa de la Bastilla, quedo muy interesada.\r\nEl 09-Abril se llamo nuevamente para ver que habia pensado y nos informo que ella aun no tiene el dinero, ella esta esperando vender la casa que tiene para poder comprar, se le ofrecio los servicios de la inmobiliaria para ayudarle a vender la casa de ella pero aun no nos ha dado una respuesta.', 1, '2018-04-10', 'si'),
