(510, 0, '2018-04-26', 'Sandra', '317 250 5802', 1, 900000, 'Entrerios', '', 'El miercoles 25-Abr se les mostro la propiedad de Entrerios en alquiler, quedaron muy interesados en tomarla siempre y cuando les coloquen gas natural.\r\nEl jueves 26-Abr se hablo con Jefry (dueño de la casa) y dijo que iba a cotizar en cuanto le salia la instalacion para tomar una decision. Volver a llamar a Jefry el viernes 27-Abr.', 5, '2018-04-26', 'si'),
(511, 0, '2018-04-25', 'Maria Enith', '318 385 7949 / 316 729 5805', 11, 270000000, '', '', 'Bancolombia.\r\nEl 25 y 26-Abr se le enviaron varias opciones al whatsapp, por llamada telefonica quedamos en que ella se acercaria el dia viernes 27-Abr a la oficina para hablar personalmente y escuchar las opciones que tenemos bifamiliares y multifamiliares.', 1, '2018-04-26', 'si'),
