(514, 0, '2018-05-03', 'Luis Francisco Suarez Forero (Hidrofas)', '318 359 6070', 1, 185000000, 'Comerciales', 'Busca una casa de un piso con 4 habitaciones y local comercial, ubicada en zona comercial y principal. ', 'El 24-May se llamo para preguntar que habia pensado sobre la casa del Salesiano de $220 de Andres, y nos informo que aun no ha podido tomar una decision porque el sobrino que es la persona con la que va a comprar no ha llegado a la ciudad y no han podido hablar sobre el tema, dijo que encuanto nos tuviera una razon se comunicaba para informarnos.', 1, '2018-05-03', 'si'),
