(519, 0, '2018-05-09', 'Jesus David Cruz', '317 584 4929', 12, 600000, 'Victoria', 'Requiere local para montar barberia.', 'El 09-May se le enseño local comercial del Victoria, le gusto mucho pero esta buscando los codeudores porque no tiene garantías.\r\nEl 15-May se llamo a preguntar si había conseguido los codeudores y nos informo que ya no estaba buscando local porque encontró uno en donde no le pedían tantos requisitos y decidió tomar ese. ', 5, '2018-05-10', 'no'),
