(530, 0, '2018-05-03', 'Paula Andrea Montero', '318 889 1046', 8, 400000000, 'Tres esquinas', 'Recomendada por Monica Vuelta Canela', 'El 03-May se le enviaron los opciones que teníamos en 3 esquinas, se trato de coordinar cita para ir a ver las propiedades pero doña Paula Andrea no tenia tiempo.\r\nEl 15-May se volvió a contactar para mostrarle las propiedades y nos informo que decidió ya no comprar en el Valle. ', 1, '2018-05-16', 'si'),
(531, 0, '2018-05-18', 'Ivan Felipe Serna', '318 712 7895', 1, 160000000, 'Nuevo Principe', '', 'El 18-May se le mostro la casa del Nuevo Principe unifamiliar de $180, ofrecio $170 en efectivo, pero el dueño dice que lo minimo es $175, que le recibe los $170 y le da plazo de 3 meses para pagar los $5 millones restantes.\r\nSe llamo el viernes 18-may, para darle el precio mínimo y nos informaron que esta fuera de la ciudad, que regresa nuevamente el viernes 25 para poder hablar con el. \r\nSe llamo el viernes 25-may, el lunes 28-may y el martes 05-Junio para preguntar que ha pensado sobre la casa y no contesta. Seguir insistiendo.', 1, '2018-05-18', 'si'),
(532, 0, '2018-05-18', 'Hector Fabio (Inversiones Tulua)', '311 6298566', 1, 0, '', '', '', 2, '2018-05-18', 'si'),
