(534, 0, '2018-05-16', 'Diana Maria', '300 610 0688', 5, 1400000, 'Victoria, Alvernia', 'Ideal para montar consultorio clinico.', 'El miércoles 16-May se le mostró la propiedad del Victoria de $1.800.000 pero no les alcanza el presupuesto.\r\nEl viernes 18-May se llamo para informar que el precio mínimo de la propiedad es $1.600.000, dijo que lo iba a consultar con los socios.\r\nEl martes 22- may se llamo y nos informo que no la van a tomar porque realmente no les alcanza el presupuesto', 5, '2018-05-22', 'si'),
(535, 0, '2018-05-22', 'Sandra (Secretaria Gustavo Delgado)', '225 4091', 1, 0, '', '', '', 6, '2018-05-22', 'si'),
(536, 0, '2018-05-21', 'Alba Candamil', '310 418 9160', 1, 210000000, 'Principe, Victoria, Salesianos.', 'Casa de un piso. ', 'El lunes 21-May se le hizo un recorrido de varias propiedades, quedo muy interesada en la casa de Brisas de Morales y en la del Victoria de $210, ambas de Gildardo.\r\nEl martes 22-May se llamo y nos informo que se estaban  inclinando por comprar la del Victoria, pero que ellos están comprando a través de crédito por Bancolombia y tiene aprobado $150 millones y ellos completan el excedente.\r\nEl miércoles 23-May se llamo y se le informo que esa casa del Victoria se la dejan en $200, nos dijo que iba a hablar con el hermano y que en cuanto tuviera una razón nos llamaba.\r\nEl lunes 28-May se llamo para confirmarle la dirección de la casa, ya que va a empezar el tramite por el banco para comprar la del Victoria de $210, hay que estar pendiente para que no vaya a hacer negocio directamente con el dueño porque ya se conocen. \r\nEl martes 05-Jun se llamo y nos informo que el banco aun no les ha dado respuesta, que ellos apenas metieron papeles para solicitar el credito y como estan comprando con dinero desde Maiami, esta demorado el proceso. ', 1, '2018-05-23', 'si'),
(537, 0, '2018-05-21', 'Amparo', '316 348 9836', 1, 850000, 'Entrerios', '', 'El 21-May se le mostro la casa de Entrerios, quedo muy interesada y se le dijo que lo minimo de ese arrendo eran $850.000, se le enviaron los requisitos y quedo en recolectar toda la informacion para venir a comprar el formulario.\r\nEl 23-May se llamo para preguntar como va con los documentos y no contesto. ', 5, '2018-05-23', 'si'),
