(544, 0, '2018-05-24', 'Oscar Estrada', '320 606 8704 Whatsapp / 312 24', 1, 0, '', '', 'Tiene apartamento para permutar en en el oeste de Cali, barrio el Peñón, edificio Varela, apto 501, de 210 mts, parqueadero doble, cuarto útil, 4 baños, 3alcobas y la de la empleada, sala, comedor y estudio, el edificio tiene ascensor y piscina...mtr2 a. $1\'900.000 para$400\'000.000.\r\n\r\n321 827 9811\r\n\r\nQuiere permutar por casa del Alvernia de $730 millones y la casa de la loma de $650 millones, coloca el apartamento y daría excedente en efectivo.\r\n\r\nSe le escribio el lunes 28-may para propgramar cita y nos informo que estaba de viaje, cuando regrese se contacta nuevamente para programar la cita.\r\n\r\nEl 10-Jul se le enseño la casa del Alvernia y La loma', 1, '2018-05-28', 'si'),
(545, 0, '2018-05-24', 'Diego (Cliente sector salud)', '318 761 3181', 1, 0, 'Sector salud, victoria o alvernia, cerca a las clinicas', 'Busca propiedad grande en sector salud de 8x40 o 10x32 aproximadamente.', 'El 24-May se le enviaron varias opciones al whatsapp.\r\nEl 28-May se le escribio nuevamente para preguntar que ha pensado sobre las opciones que se le enviaron pero no responde los mensajes.', 1, '2018-05-28', 'si'),
(546, 0, '2018-05-24', 'Pilar', '315 241 1644', 2, 100000000, 'Salesianos, Principe, Victoria, Sajonia, Lusitania', 'Busca propiedad economica en sector cerca al centro, barrios buenos, no importa que sea pequeño.', 'El 24-May se le mostro el apartamento de Lusitania de $90 millones pero las habitaciones le parecieron muy pequeñas, se le iba a mostrar el apartamento que tiene Elvia en lusitania pero ya lo conoce porque Elvia tambien le esta buscando propiedad. Seguirle buscando.', 1, '2018-05-28', 'si'),
(547, 0, '2018-05-29', 'Katherine Sanclemente ', '317 275 3540', 1, 170000000, 'salesiano, príncipe, sajonia  ', 'Casa pequeña con espacios abiertos para una persona. ', 'El 29-May se le enseño la del Nuevo Principe de $180 y la del Sajonia esquinera de $170, quedo interesada en la del Nuevo Principe, hacerle seguimiento. \r\nTeléfono de la mamá 317 459 1713\r\nFijo  225 4824\r\n', 1, '2018-05-30', 'si'),
(548, 0, '2018-05-21', 'Luis Andres', '313 456 9088', 1, 0, '', '', 'Tiene casa para la venta en Andalucia, se le ofrecieron todos los servicios, pero quedo en hablar con la mama que es la dueña para confirmarnos si en realidad la quieren colocar en venta o no. Volver a llamar la primera semana de Junio. ', 2, '2018-05-31', 'si'),
(549, 0, '2018-05-31', 'Mauricio', '314 879 3040', 2, 0, '', '', 'Busca apartamento o casa hasta $90 millones, solo quiere en los barrios de arriba, se le iba a mostrar el apartamento de Lusitania pero nos dice que no le interesa porque son demasiado pequeños. Seguirle buscando. ', 1, '2018-05-31', 'si'),
(550, 0, '2018-05-22', 'Ana Maria Tobar', '316 743 3260', 1, 200000000, 'Nuevo Principe, Villa Campestre, Nuevo Alvernia, Entrerios', 'Busca casa unifamiliar con garaje, 3 habitaciones como minimo, la principal con baño y cocina integral. ', 'El 23-May se le enviaron varias opciones al whatsapp y el mismo dia se le hizo recorrido, se le mostro la del Nuevo Principe de $180, Nuevo Principe de $235.\r\nEl 25-May se le envio la casa que nos ingreso en Entrerios de $200 pero no nos ha confirmado si desea verla o no. Llamarla el viernes 01-Jun.\r\n\r\nTambién tiene 3 locales en el edificio de Bancoomeva (Carrera 27 No. 25-100 frente a los juzgados) para entregar en administración, Andrea hizo la visita, se tomaron las fotografías y se sugiere que los precios de alquiler están entre $1.800.000 y $2.500.000 según el área y el piso. El 25-May se le escribio al whatsapp para preguntar cuando posia pasar por la oficina para coordinar el tema de la administracion pero aun no nos ha dado respuesta.\r\nPiso 1 - Local de 108 Mts 2\r\nPiso 2 - Local de 116 Mts 2\r\nPiso 3 - Local de 115 Mts 2 ', 1, '2018-05-31', 'si'),
(551, 0, '2018-05-23', 'Maria Nubia Ospina', '321 986 6578', 1, 0, '', '', 'El 23-May llamo la hija de doña Nubia informandonos que ella vivia en el exterior y queria comprar casa para que le hicieramos un recorrido a la mama, le interesa ver la del Nuevo Principe de $180, ese mismo dia se llamo a la mama para coordinar la cita y nos informo que iba a hablar bien con la hija para tener una idea de lo que ella queria comprar.\r\nVolver a llamar el 01-Jun para empezar recorrdo. ', 1, '2018-05-31', 'si'),
(552, 0, '2018-05-23', 'Norbey Garcia', '313 735 0900', 3, 0, '', '', 'Interesado en lote del callejon San Jose de $150 millones.\r\nSe llamo el jueves 24-May para enseñarle el lote pero nos informo que habia salido de viaje, que en cuanto regresara se volvia a comunicar para programar la cita.', 1, '2018-05-31', 'si'),
(553, 0, '2018-05-28', 'Lilian Andrade', '314 691 5115', 1, 220000000, 'Busca casa grande en sector comercial, centro, salesianos.', '', 'El 28-May se le hizo recorrido de varias propiedades, hay que llamarla el viernes 01-Jun para preguntarle que ha pensado o por cual de todas se decidió. \r\nEl 31-May se le hizo recorrido de propiedades con Gabriela en el Victoria, quedo muy interesada en una de $280 millones sobre la carrera 33 (cerrajeria pintada de negro - negocio de gorras). Llamar el martes 05-Jun para saber por cual se decidio. \r\nEl 05-Jun se llamo y nos informa que ya negocio una casa bifamiliar que le da mejores rentas ubicada en Villa Nueva.\r\n\r\nEl 31-May se cito en una casa de Gabriela en la Carrera 33 No. 28A - 31 Victoria de 8.50 x 45 Mts 2', 1, '2018-05-31', 'no'),
(554, 0, '2018-05-28', 'Clara Ines ', '315 836 8672', 3, 70000000, 'Tamboral y Campo Alegre Andalucia. ', '', 'El 29-May se estuvo llamando en varias ocasiones para hacerle recorrido pero el telefono estaba apagado, se le dejo mensaje de voz para que nos devuelva la llamada y podamos mostrarle las propiedades. ', 1, '2018-05-31', 'si'),
(555, 0, '2018-05-29', 'Aura Ines Sanchez', '233 2595', 1, 0, '', 'Busca casa en alquiler unifamiliar de 4 o 5 habitaciones pero que 2 de estas queden en el primer piso', '', 5, '2018-05-31', 'si'),
(556, 0, '2018-05-29', 'Julia Marcela ', '224 0462 / 315 329 3434', 1, 0, '', 'Busca casa en sector salud para montar clinica de ecografias.', 'El 29-May se les enseño la casa del Victoria de $1.850.000, estan interesados en tomarla y van a empear proceso de estudio de arrendamiento. ', 5, '2018-05-31', 'si'),
(557, 0, '2018-05-31', 'Alexander Urbano Motato', '315 507 9632', 1, 0, '', '', 'Se le debe responder por $51 millones libres sobre el apartamento de Marandua. ', 2, '2018-05-31', 'si'),
(558, 0, '2018-06-05', 'Natalia ', '317 434 0603', 1, 0, 'El Laguito', '', '', 2, '2018-06-05', 'si'),
(559, 0, '2018-06-05', 'Luz Adriana Ramirez', '317 373 1480', 1, 700000, '', '', 'Se le mostró la casa del Nuevo Fatima Piso 1 pero no le gusto porque las 2 casas se comunican y se escucha todo. ', 5, '2018-06-06', 'si'),
(560, 0, '2018-06-05', 'Jesus', '313 719 5595', 1, 200000000, '', '', 'Cliente que se le hizo recorrido de varias casas, pero solo le intereso la casa de Entrerios de $200 millones de doña Carmen Elisa, se negocio en $190 para que la comprara, son $100 millones en efectivo y $90 millones por el banco.\r\nEl 06-Jun se le entrego personalmente a don Jesus paz y salvo municipal y se envio copia del certificado de tradicion y de la escritura con don Victor Borja para llevar documentos al banco e iniciar tramite. \r\nEl 12-Jun se llamo para saber como va la gestion con el banco y nos informo que esta esperando que le den el nombre del perito que le asignaron, que el banco llama primero a informarnos aqui en la inmobiliaria. Entre jueves 14 y Viernes 15 se sabe quienes el perito.\r\nEl 15-Jun don Jesus hablo con Andrea y le informo que faltaban unos desprendibles de pago para continuar con el proceso, don Jesus llevo los documentos al banco y hay que seguir esperando.\r\nEl 19-Jun don Jesus fue al banco para ver como iba el proceso y no le dieron razon, dicen que esta en tramite pero no le dan claridad de nada.', 1, '2018-06-06', 'si'),
(561, 0, '2018-06-05', 'Marco Canizales', '311 326 6163', 1, 170000000, '', '', 'El 05-Jun se le mostro casa del Nuevo Principe de $180 millones, quedo muy interesado, esta comprando a traves de credito hipotecario. Se le entrego carpeta con certificado de tradicion, escritura, licencia de construcion y planos para que los llevara al banco.\r\nLlamar el 06-Jun para preguntar como le fue en el banco, por cual banco esta realizando la gestion, a quien le asignaron como perito, etc...???\r\n', 1, '2018-06-06', 'si'),
(562, 0, '2018-06-05', 'Johanna (Barranquilla)', '301 436 3071', 1, 180000000, '', '', 'El 01-Jun se le mostro la casa del Nuevo Principe de $180, quedo muy interesada pero esta comprando a traves de credito con Bancolombia por Barranquilla, se negocio la casa en $178, tiene los $80 millones en efectivo y los $98 son por credito.\r\nSe llamo el 05-Jun para preguntar como iba con la gestion del banco y nos informo que apenas este fin de semana viajaba a Barranquilla para tramitar todo, volver a llamar el Jueves 14-Jun.', 1, '2018-06-06', 'si'),
(563, 0, '2018-06-07', 'Diana Patricia ', '316 895 2710', 12, 0, '', '', 'Busca local comercial para montar salón de arreglo de uñas.\r\nEl viernes 08-Jun se le mostro local esquinero del Nuevo Principe de $650.000 pero no le sirve porque esta muy retirado, necesita algo mas central. ', 5, '2018-06-12', 'si'),
