(566, 0, '2018-05-31', 'Yaneth Ortegon Ariza', '311 368 9807', 1, 0, '', '', 'Clienta interesada en tomar casa Entrerios $850', 5, '2018-06-14', 'si'),
(567, 0, '2018-06-13', 'Jorge Gomez', '318 680 0966', 1, 55000000, '', '', 'Cliente de la oficina pero la propiedad se la enseño Elvia. \r\nEl 14-Jun se le mostro el apartamento de Marandua de $55 millones. Se le ofrecio tambien la casa de Zarzal de $54 millones.\r\n', 1, '2018-06-14', 'si'),
(568, 0, '2018-06-12', 'Yaneth Mesa', '320 748 6751', 1, 0, '', '', 'El miercoles 13-Jun se le hizo cita a las 7:30 am con Elvia para mostrar apartamento de Marandua $55, la clienta no llego, dijo que amanecio enferma y que quedaba pendiente para volver a coordinar la cita.', 1, '2018-06-14', 'si'),
