(602, 0, '2018-07-11', 'Ana Diaz (Compradora) / Martha Cecilia Galvez (Sobrina)  ', '302 290 3493 / 317 256 9304', 1, 180000000, '', 'Busca casa pequeña, de un piso, 2 habitaciones, buen sector y buenos acabados. ', 'Tiene prestamo con Coomeva por $50 millones, para poder comprar depende de la venta de un apartamento que tiene en Cali de $330 millones.\r\nQuedo muy interesada en la casa del Salesianos de $150 millones de don Manuel.\r\nLlamar el martes 17-Jul para preguntar como le fue con el cliente que le iba a comprar el apartamento en Cali.\r\n\r\nEl 12-Jul la clienta fue directamente a la casa de don Manuel y la persona que la atendió le informo que esa casa la habían comprado hace 2 meses y no esta para la venta, por lo cual la clienta se molesto porque se le ofreció una casa que ya no estaba disponible.  ', 1, '2018-07-12', 'si'),
(603, 0, '2018-07-11', 'Adiela ', '318 810 8287 / 232 5905', 1, 160000000, '', 'Busca propiedad hasta $160 millones, compra por medio de banco en barrios buenos, no le gusta el Victoria.', 'El 11-Jul se le enseño la casa del Nuevo Principe de $180 millones pero no le gusto el piso.\r\n\r\nEl 12-Jul se le enseño la casa de Buenos Aires de $160 (No le gusto porque esta muy retirada), La Bastilla de $168 (No le gusto) y la del Fatima de $155 (Le intereso pero el precio le parece muy alto para todo lo que hay que arreglarle a la casa).\r\n\r\nLlamarla el 13-Julio porque va a hacer una oferta para la casa del Fatima $155. Se llamo pero no contesto.\r\nSe llamo el 16-Jul pero no contesto.\r\n', 1, '2018-07-12', 'si'),
(604, 0, '2018-07-10', 'Heny Yahia Onaissi', '318 889 4706', 1, 0, '', 'Busca casa para alquilar muy bien ubicada, con excelentes acabados.', 'El 10-Jul se le enseño la casa del Laguito de $1.350.000 pero nos dijo que el precio le parecia demasiado costoso, y el espacio de la sala es muy pequeño. Se le ofrecio tambien la casa para compra pero no le intereso.\r\nEsta pendiente si nos ingresa una nueva casa para ofrecerla', 5, '2018-07-12', 'si'),
(605, 0, '2018-07-10', 'Gloria Oquendo', '321 847 9498', 1, 0, '', 'Presupuesto $160', 'El 12-Jul se le enseño la casa de la Bastilla, le gusto, pero dice que va a hablar con el socio para ver a que decisión llegan. \r\nLlamarla el 13-Julio para saber que decision tomaron o para buscarle mas opciones.\r\nEl 16-Jul se llamo para saber que había pensado y nos dijo que no le intereso la casa, buscan algo mas cercano al sector de las clinicas con bajo presupuesto, se le enviaron nuevas opciones al whatsapp, pendiente coordinarle una nueva cita.\r\nEl 17-Jul se le mostró la casa de Tomas Uribe $160 pero no le gusto porque la calle es muy transitada y la casa de Owar de $180 le gusto pero no le alcanza el presupuesto, solo tiene $150.', 1, '2018-07-13', 'si'),
(606, 0, '2018-07-10', 'Alba Patricia Ospina ', '314 602 2505', 1, 0, '', '', 'Busca casa en alquiler hasta $400.000.\r\nCuando llamo solo teniamos la del Laguito $1.350.000 y se le sale del presupuesto. ', 5, '2018-07-13', 'si'),
(607, 0, '2018-07-10', 'Maira Pelaez', '317 382 4959', 11, 0, '', 'Busca propiedad bifamiliar hasta $180 millones.', 'El 13-Jul se le enviaron varias opciones al whatsapp, esta pendiente confirmar cuales quiere ver para coordinarle cita.', 1, '2018-07-13', 'si'),
(608, 0, '2018-07-10', 'Marleny Saavedra', '314 204 0887', 1, 0, '', '', 'Correo: marmsw@hotmail.com\r\nTiene casa para entregarnos en Administración en Villa Campestre.\r\nLa clienta quedo en recibirla completamente por parte de otra inmobiliaria para así poderla entregar para ofrecer.\r\nLlamar el lunes 16-Jul para saber si nos la va entregar o no?-', 4, '2018-07-13', 'si'),
(609, 0, '2018-07-12', 'Maria Elena Oquendo', '317 369 1783', 1, 250000000, 'Entrerios, Sajonia, Nuevo Principe.', 'Busca casa amplia, con buenos acabados y como minimo con 4 habitaciones. ', 'El 12-Jul se le enviaron varias opciones al whatsapp, quedo muy interesada en ver la del Nuevo Príncipe de $230.\r\nEl 13-Jul se le enseño la del Nuevo Príncipe de $230.', 1, '2018-07-13', 'si'),
(610, 0, '2018-07-16', 'Wilson Gomez', '315 572 6342 /  314 772 1440', 1, 0, '', '', 'Dueño de casa unifamiliar esquinera en Cali - Casa Cristales III\r\nSin corretaje - recomendado por Francisco Calero (arrendatario casa Entrerios Piso 1)', 2, '2018-07-16', 'si'),
(611, 0, '2018-07-06', 'Jorge Choachi', '316 289 8267', 1, 200000000, '', '', 'El 06-Jul se le enseño la del Nuevo Prinicipe de $180 y Urb. La Villa $210, quedo muy interesado en la casa de la Villa.\r\n\r\nEl 16-Jul se llamo nuevamente para saber por cual casa se habia decidido pero informa que aun esta discutiendo el tema con la hija, que en cuanto se pongan de acuerdo se estará comunicando para definir. \r\n\r\nEl 23-Jul se le mostró la casa de Entrerios de $190, le va a enviar la informacion a la hermana que es la que esta comprando y nos confirma que decisión tomaron. ', 1, '2018-07-16', 'si'),
(612, 0, '2018-07-17', 'Raul ', '315 491 3202', 4, 0, '', 'Busca bodega apta para montar taller metalúrgico.', 'Cliente recomendado por la abogada Victoria Eugenia.\r\n\r\nEl 17-Jul se le envio al whatsapp información sobre la bodega de la variante de $4.000.000, pero dice que ya la conocia y que no le sirve porque tiene vecindario a sus alrededores y no es permitido por el ruido que generan. ', 5, '2018-07-17', 'si'),
(613, 0, '2018-07-16', 'Claudia Gomez', '315 298 0513', 8, 0, '', '', 'El 17-Jul se le mostro la propiedad de Andalucia, Tamboral de $365 millones (La propiedad la mostro Elvia y Lili).\r\nLa clienta quedo muy interesada en la casa, hizo una oferta de $320 millones y el dueño dice que lo minimo es $145. Elvia esta manejando el negocio. ', 1, '2018-07-17', 'si'),
