(616, 0, '2018-06-14', 'Victor Guerrero', '316 748 9504', 1, 0, '', 'Compra propiedad en Cali', 'El 18-Jun se le enseño propiedad unifamiliar en Cali pero no le sirve porque busca bifamiliar.\r\nDiego Guzman quedo con el contacto del cliente para seguirle buscando propiedad en Cali.', 1, '2018-07-18', 'si'),
