INSERT INTO `sai_propiedades` (`id_propiedad`, `fecha_creacion`, `id_tipo`, `id_ciudad`, `id_barrio`, `direccion`, `precio`, `caracteristicas`, `observaciones`, `id_objetivo`, `id_propietario`, `id_arrendatario`, `documento`, `prop_activo`) VALUES
