(314, '2018-05-25', 16, 1, 55, '', 100000000, 'Se vende finca cañera de 110 plazas sobre vía pavimentada en la ciudad de Tulua. Consta de casa, variedad de caña 8275 y 8592 entre segundo y quinto corte, sistema de riego por gravedad, reservorio, aguas de rió Tulua y Cauca, tubería enterrada. Cuenta con una producción entre 150 a 200 toneladas por hectárea SE VENDE TODA LA PROPIEDAD - PRECIO DE VENTA POR PLAZA $100.000.000', 'Sin corretaje.', 1, 6, 6, NULL, 'si'),
(315, '2018-05-25', 3, 1, 78, 'Cerca a la 14', 1000000, 'Se vende lote de 11.144 Mtrs2, excelente ubicación, sobre la variante de Tulua, zona altamente comercial, terreno totalmente plano, ideal para proyectos como: centro comerciales, estaciones de servicios, proyectos de apartamentos. VALOR POR METRO CUADRADO $1.000.000-', '', 1, 325, 325, NULL, 'si'),
(316, '2018-05-25', 10, 1, 6, 'Calle 31 No. 43 - 37 (San Benito)', 780000000, 'Se venden dos edificios multifamiliares en el barrio Lomitas, cerca a Villa Campestre. Construcción nueva con excelentes acabados, con un total de 10 rentas, 5 por cada edificio.... VALOR DE LA INVERSIÓN $780.000.000-\r\nPor serparado c/u $395 millones', 'Sin corretaje.\r\nComisión Lili 1%', 1, 122, 122, NULL, 'si'),
(317, '2018-05-25', 1, 1, 24, 'Calle 18 No. 38 - 80', 450000000, 'Espectacular casa unifamiliar de dos pisos en el Barrio Entrerios. Área del terreno 270 Mtrs 2. Área construida 357 Mtrs 2. La casa consta de garaje doble eléctrico, salones grandes, cocina integral, 5 alcobas grandes con closet, 5 baños completos patio de luz y patio de ropa.', 'Sin corretaje. \r\nPromesa de Compraventa No. 059.', 1, 543, 543, NULL, 'no'),
(318, '2018-05-29', 3, 3, 70, '', 40000000, '', '', 1, 325, 325, NULL, 'no'),
(319, '2018-05-29', 1, 1, 22, 'Carrera 32 A No. 21-12', 190000000, 'Se vende casa grande en segundo piso (propiedad horizontal) ubicada en el barrio Alvernia. Área construida 14 Mts de frente por 22 Mts de fondo (638 Mts 2). La casa consta de garaje, salones grandes, cocina sencilla, 4 habitaciones grandes con closet, 3 baños y patio de ropa. ', 'Sin corretaje.', 1, 47, 47, NULL, 'si'),
(320, '2018-05-31', 2, 1, 130, 'Calle 25c No. 11 - 55', 55000000, 'Se vende apartamento pequeño de dos pisos remodelado en el barrio marandua, cuenta con un área de 4.50 metrso de frente por 5 de fondo. Consta de: 2 habitaciones, sala, comedor, cocina sencilla, un baño social y una terraza pequeña como zona de aseo... ', 'Propiedad sobre pasaje.   Sin corretaje.... Se le responde al propietario por $51 millones libres. ', 1, 557, 26, NULL, 'no'),
