(322, '2018-06-01', 1, 1, 4, 'Cra 34 calle 35 esquina barrio fatima.', 160000000, ' Se vende propiedad en el  barrio fatima esquinera de un piso.\r\nConstrucción antigua.\r\nArea 14 Mts de frente por 11.50 Mts de fondo (161Mts2).\r\nConsta de :\r\nLocal comercial pequeño , apartaestudio y casa.\r\nLa casa consta de sala comedor 3 alcobas sin clossets , cocina sencilla y zona de oficios...', 'Sin corretaje', 1, 38, 38, NULL, 'si'),
