(328, '2018-06-15', 1, 1, 27, 'Manzana 29 Casa 21', 420000, 'Se alquila casa en el barrio Bosques de Maracaibo. Direccion: Manzana 29 Casa 21. La casa consta de sala - comedor, cocina integral, 3 habitaciones, baño social y patio de ropa. ', '', 2, 198, 198, NULL, 'si'),
(329, '2018-06-18', 1, 1, 2, '', 270000000, 'Hermosa casa para la venta en el Barrio Villa Campestre - Unifamiliar de 2 pisos - area construida 8 x 18 - 144 mts2 construidos por piso. El primer piso consta de 1 habitación con baño, cocina semi integral, garaje, sala comedor grande, patio de ropas y patio de luz grande. El segundo piso consta de plancha toda la casa y hacia la parte de adelante consta de 1 habitación con baño, baño social y un salón grande. Excelentes acabados. ', 'Solo pagan $5.000.000 millones de comisión.', 1, 161, 161, NULL, 'si'),
(330, '2018-06-18', 1, 1, 85, '', 550000000, 'propiedad ubicada a dos cuadras del parque boyaca. \r\nConsta de una casa grande y dos locales comerciales. \r\nÁrea 11 Mts de frente x 43 de fondo. \r\n473MTS2... ', 'Propiedad compartida por Gildardo comisionista.', 1, 276, 276, NULL, 'si'),
