(332, '2018-06-20', 1, 1, 50, '', 125000000, 'Se vende hermosa casa de un piso con plancha para estrenar en el barrio Saman del Norte, la propiedad cuenta con futura para casa independiente. Consta de: tres habitaciones con closets, 2 baños, comedor, sala - garaje, cocina, patio de luz y patio de ropas, pisos en cerámica y plancha con entrada independiente y espacio para moto. ', 'Propiedad compartida por Andres', 1, 6, 6, NULL, 'no'),
