(334, '2018-06-26', 1, 1, 10, 'Carrera 25 No. 22 - 24', 270000000, 'Se vende casa grande con local y apartamento independiente para remodelar, ubicada en el barrio Escobar, punto altamente comercial. Área 351 Mtrs. Consta de: CASA: 3 habitaciones, cocina sencilla, sala, comedor, pasillo, baño, y patio de ropa grande; APARTAMENTO: Sala, 1 habitación, baño, cocina. ', 'Corretaje No. 087\r\nPrecio que se le sugiere al propietario $190, pero no estuvo de acuerdo. ', 1, 578, 578, NULL, 'si'),
