(337, '2018-06-29', 6, 32, 134, '', 700000000, 'Se vende excelente propiedad, finca agrícola con muy buena producción, ubicada en la vereda el Palmar de Restrepo Valle. Con un área de 38.428 Mtrs2 (6 plazas). Consta de casa en material de dos pisos, bifamiliar, cada casa consta de: primer piso; Sala, comedor, cocina, 2 baños completos, 4 habitaciones.Segundo piso: salón grande, 2 habitaciones grandes, baño social y baño en la alcoba principal, cocina semintegral... La finca tiene producción de: 120 mil matas de piña oro miel con sistema de riego, 15 mil matas de sabila con sistema de riego, 500 matas de plátano, guayabo, banano y cítricos, 53 mil matas de ají, aguas de nacimientos, aguas de acueducto y poso séptico. Un lago con capacidad para 30 mil peces en calefacción', 'Corretaje No. 090\r\nPropietaria Yamileth Saavedra Tel: 315 405 2782\r\nHipoteca por $93 Millones con Banco Agrario de Colombia / Cuota mensual de $4.000.000 por 30 meses.', 1, 590, 590, NULL, 'si'),
(338, '2018-06-29', 1, 1, 52, '', 130000000, 'SE VENDE CASA PARA ESTRENAR ESQUINERA EN EL BARRIO SANTA INES AREA 106 MTS2 SOBRE VIA PRINCIPAL 2 HABITACIONES, CLOSET, VESTIER, 2 BAÑOS, SALA, COMEDOR, COCINA INTEGRAL, GARAJE O LOCAL, PISOS EN PORCELANATO, GRADAS PARA LA PLANCHA INDEPENDIENTES . PLANCHA ', 'Sin Corretaje.\r\nPropiedad de Andres Comisionista, coordinar citas con el. ', 1, 6, 6, NULL, 'si'),
(339, '2018-06-29', 1, 1, 3, 'Manzana 21 No. 37 - 44 o Calle 13 D No. 37 - 44 ', 210000000, 'Hermosa casa unifamiliar de 3 pisos en la Urbanización La Villa. Area 6.50 Mts de frente por 12 Mts de fondo (253 Mts 2) El primer piso consta de sala grande, comedor, cocina integral, habitación con baño y amplio patio de ropas. El segundo piso consta de 4 habitaciones (habitación principal con baño), cuarto de estudio y baño social compartido. El tercer piso consta de terraza cubierta, baño y closet.', 'Corretaje No. 091\r\nPropiedad al día, libre de gravámenes. \r\nCerca a la iglesia de la Urb. La Villa.', 1, 586, 586, NULL, 'si'),
