(343, '2018-07-16', 1, 2, 136, 'Carrera 31 A oeste No. 11 A - 21. ', 750000000, 'Se vende o se permuta propiedad unifamiliar esquinera de tres pisos totalmente renovada al Oeste de Cali (Valle) / Barrio Cristales 3. La casa consta de ante jardín, garaje eléctrico doble, sala, comedor, estudio, 4 Alcobas con closet de linos, (cuarto de servicio con baño y alcoba principal con baño y vestier doble), 4 baños, hall de alcobas y patio interior (estadero). PRECIO DE VENTA $750.000.000 NEGOCIABLES / SE RECIBE LA MITAD EN PERMUTA POR VEHÍCULO O PROPIEDAD EN EL NORTE DEL VALLE - LA OTRA MITAD SE RECIBE EN EFECTIVO.', 'Sin corretaje.\r\nRecomendado por Francisco Calero (Arrendatario Entrerios Piso 1)', 1, 610, 610, NULL, 'si'),
(344, '2018-07-18', 6, 22, 55, '', 1800000000, 'Hermoso hotel campestre ubicado a 10 minutos de la ciudad de buga ( el milagroso) en el sector de puente abadia.\r\nCuenta con 21 habitaciones, conformadas por cabañas y suites, todas con baño privado, amplias zonas verdes, zona de hamacas mirador, dos piscinas, salón de eventos y cocina, zona de asados, jacuzzi, sauna. \r\nTambién cuenta con dos apartamentos estilo loft, totalmente independientes.', 'Sin corretaje.', 1, 614, 614, NULL, 'si'),
(345, '2018-07-18', 1, 1, 24, 'Carrera 37 No. 16 - 58', 190000000, 'Se vende propiedad unifamiliar en el barrio entrerios con área de 99 Msts2 la casa consta en el primer piso de sala, comedor, cocina, garaje, patio  una habitación grande con closet y baño privado, en el segundo piso  3 habitaciones con closet (la principal con baño) baño social, patio, terraza.', 'Sin corretaje', 1, 617, 617, NULL, 'si'),
