(347, '2018-07-24', 3, 1, 15, 'Lote 9 Manzana 18', 80000000, 'Lote con excelente ubicación, sobre vía pavimentada. Área 7.08 Mts de frente por 13.665 Mts de fondo (96.75 Mts 2).\r\n', 'Sin corretaje.\r\nPropiedad recibida por Andrea con acompañamiento de Elvia.', 1, 622, 622, NULL, 'si'),
(348, '2018-07-24', 3, 1, 76, 'Lote 10 Manzana F', 40000000, 'Lote ubicado en la Urbanización La Paz. Área 6 Mts de frente por 14 Mts de fondo (84 Mts 2).', 'Sin corretaje.\r\nPropiedad recibida por Andrea con acompañamiento de Elvia.\r\nEste lote en realidad esta ubicado en Los Caimos - Aguaclara.', 1, 622, 622, NULL, 'si'),
(349, '2018-07-25', 1, 1, 138, '', 120000000, 'Casa de un piso con plancha (futuro y espacios para construcción unifamiliar o bifamiliar), ubicada en el barrio El Bosque. Construcción nueva. Área construida 7 Mts de frente por 13 Mts de fondo (91 Mts 2). La casa consta de sala garaje, cocina integral, 3 alcobas con closet, baño social y patio de ropa.', 'Sin corretaje.\r\nPropiedad compartida por Gildardo (1.5% Oficina y 1.5% Gildardo)', 1, 276, 276, NULL, 'si'),
(350, '2018-07-25', 3, 3, 70, '', 75000000, 'Se venden 2 lotes campestres en sector rural, Campo Alegre - Andalucía, excelente ubicación a orilla de carretera, documentos al día. Área de cada lote 1.000 Mtrs 2. PRECIO DE VENTA DE CADA LOTE $75.000.000', 'Sin corretaje.\r\nLotes compartidos por Edgar Comisionista.\r\n(1.5% comisión)', 1, 357, 357, NULL, 'si'),
(351, '2018-07-25', 11, 1, 130, 'Calle 25 C No. 08 - 72 / Lote 1 Manzana H', 130000000, 'Propiedad bifamiliar en el barrio Marandua. Área del terreno 6.50 Mts de frente por 19 Mts de fondo (123 Mts 2). Área construida 200 Mts 2 Aproximadamente. El primer piso consta de sala comedor, cocina sencilla, 3 habitaciones sin closet, baño social, patio de luz y patio de ropa. El segundo piso se encuentra en obra gris y consta de sala comedor, cocina sencilla, baño social, 3 habitaciones sin closet, hall, patio de luz y patio de ropa. ', 'Corretaje No. 094\r\nPropiedad libre de todo gravamen.\r\nSe recibe lote rural en 3 Esquinas, base $80 millones', 1, 627, 627, NULL, 'si'),
