(353, '2018-07-27', 1, 1, 19, 'Citar en la casa del pandebono sobre la paso ancho', 140000000, 'Casa de un piso en el barrio El Príncipe. Área 5 Mts de frente por 22 Mts de fondo (110 Mts 2). La casa consta de sala garaje, comedor, cocina, 3 alcobas (alcoba principal con baño), baño social y patio de ropa.', 'Sin corretaje.\r\nPropiedad compartida por Elvia.', 1, 177, 177, NULL, 'si');
